import React from 'react';

function QuerryFunction({ onClick, children, content }) {
    return (
        <div>
            <input value={content} />
            <button
                onClick={() => alert(children)}
            >
                Click Here!
            </button>
        </div>
    )
}

export default QuerryFunction
